import React from 'react';
import './App.css';

function Navbar() {
  return (
    <nav className="navbar">
      <div className="nav-logo">mygate</div>
      <ul className="nav-links">
        <li>Communities</li>
        <li>Locks</li>
        <li>Brands</li>
        <li>Business</li>
        <li>Company</li>
        <li>Login</li>
      </ul>
      <button className="book-btn">Book a Demo</button>
    </nav>
  );
}

export default Navbar;
